import React from 'react'
import { TextField, Button } from '@material-ui/core'

function StoryField() {
    return (
        <div style={{ textAlign: "center", margin: "0 auto", width: "40%", height: "50vh" }}>
            <TextField label="Title" />
            <TextField multiline variant="outlined" style={{ width: "98%", marginTop: "1rem" }} rows="15" />
            <Button>Submit</Button>
        </div>

    )
}

export default StoryField
